import styled from "styled-components";
import { ImageContainer, RowSpaceBetween, SpaceHolder } from "../styled";
//@ts-ignore
import Logo from "../assets/images/logo.png";

const Header = () => {
    return (  <HeaderWrapper>
        <ImageContainer width="50px" height="50px" src={Logo}/>
        <SpaceHolder width="50px" height="50px"/>
    </HeaderWrapper>);
}

export default Header;
const HeaderWrapper = styled(RowSpaceBetween)`
max-height: 80px;
min-height: 80px;
border-bottom: 1px solid rgba(180, 180, 180, 1);
width: 100vw;
height: 100%;
`;

export const SearchBarBody = styled.div`
mawidth: 598px;
height: Fixed (40px)px;
top: 20px;
left: 457px;
padding: 10px 20px 10px 20px;
gap: 150px;
border-radius: 8px 0px 0px 0px;
border: 1px 0px 0px 0px;
opacity: 0px;

`
